const Shop = ({ cart, setCart, addToCart, shop }) => {

    const products = shop.map(item => {
        return (
            <li>
                <div className="product-card">
                    <img src={item.image}></img>
                    <div className="product-info">
                        <div>{item.name}</div>
                        <div>{item.price}</div>
                    </div>
                    <button>Add to Cart</button>
                </div>

            </li>

        )
    })

    return ( 
        <div className="shop-container">
            <ul>
                {products};
            </ul>
        </div>
     );
}

export default Shop;
